import React from "react";

import { Box, Container, Grid, List } from "@mui/material";
import { styled } from "@mui/material";

const Niti = styled("div")((theme) => ({}));

function Home() {
  return (
    <>
      <Container>
        <Grid container>
          <Grid item xs={12} sm={6}></Grid>
        </Grid>
      </Container>
    </>
  );
}

export default Home;
